.  Berikut ini Beberapa Khasiat Manjakani KANZA :
1. Memulihkan elastisitas organ intim kewanitaaan (kencangkan otot Miss V), Kembali Perawan
2. Menghilangkan gatal-gatal, Keputihan dan bau yang kurang menyenangkan.
3. Menstabilkan PH asam dan mengurangi cairan (basah) berlebihan (tidak kering).
4. Mempertingkatkan daya alat kelamin.
5.Membina rahim dan membersihkan (selepas bersalin / haid)
6.Mencegah Kanker Serviks.
7. Mengeluarkan kotoran dari miss V dan miss V akan terasa menyempit dan anda merasa kembali spti gadis lg
8. membunuh kuman dan bakteri yang menimbulkan rasa gatal2 di miss v
9. Program Hamil
10. Kista Rahim

Dosis dan Cara Pakai Manjakani:
1. Keputihan parah/kista/myom: masukkan ke miss V, seminggu 1-2 kali @ 2 butir sekaligus.
2. Keputihan biasa, untuk perawatan rutin, menghilangkan bakteri, infeksi saluran kencing, merapatkan, melancarkan haid, miss v yg bau/gatal : masukkan ke miss V, seminggu 1-2 kali @ 2 butir
3. Promil : masukin 1 butir seminggu 1x setelah haid, saat subur jng pakai kanza.
4. Wasir: hancurkan kanza , teteskan air dikit lalu oleskan ke wasir. minum 4 butir sehari.

